import Navigator from "../OSCEPage/Navigator";

type UserPageProps = {};

const UserPage = (props: UserPageProps) => {
    return (
        <>
            <Navigator selection={"Home"} />

            <div>
                welcome!
                <Link to="/OSCE">OSCE</Link>
            </div>
        </>
    );
};

export default UserPage;
